package Collection;import java.util.Enumeration;import java.util.Iterator;import java.util.ListIterator;import java.util.Vector;public class ImplementationClassOfCursor {    public static void main(String[] args) {        Vector v  = new Vector();        Enumeration e = v.elements();        Iterator iterator = v.iterator();        ListIterator listIterator = v.listIterator();        System.out.println(e.getClass().getName());        System.out.println(iterator.getClass().getName());        System.out.println(listIterator.getClass().getName());    }}